import { createRouter, createWebHistory } from "vue-router";
import MainPage from '../views/MainPage.vue'
import userLogin from '../views/userLogin.vue'
import userJoin from '../views/userJoin.vue'

const routes = [
  {
    path: '/',
    name: 'MainPage',
    component: () => import(/* webpackChunkName: "mainpage" */ '../views/MainPage.vue')
  },
  {
    path: '/join',
    name: 'userJoin',
    component: () => import(/* webpackChunkName: "userjoin" */ '../views/userJoin.vue')
  },
  {
    path: '/login',
    name: 'userLogin',
    component: () => import(/* webpackChunkName: "userjoin" */ '../views/userLogin.vue')
  },
  {
    path: "/naverlogin",
    name: "naverlogin",
    component: () =>
      import(/* webpackChunkName: "naverlogin" */ "../views/NaverLogin.vue"),
  },
  {
    path: "/mypage",
    name: "myPage",
    component: () =>
      import(/* webpackChunkName: "mypage" */ "../views/myPage.vue"),
  },
  {
    path: '/mypage',
    name: 'myPage',
    component: () => import(/* webpackChunkName: "mypage" */ '../views/myPage.vue')
  }


]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
});

export default router;
